%   data: {"dataType":"text","outputData":{"text":"--- help for <strong>udbase\/plot_fac_type<\/strong> ---\n\n  A method for plotting the different surface types used in a\n  geometry.\n \n  <strong>plot_fac_type<\/strong>(OBJ) plots the surface types for all buildings\n \n  <strong>plot_fac_type<\/strong>(OBJ, building_ids) plots the surface types only for \n  the specified building indices (array of positive integers)\n \n  Examples:\n    % Plot surface types for all buildings\n    obj.<strong>plot_fac_type<\/strong>();\n \n    % Plot surface types for specific buildings\n    obj.<strong>plot_fac_type<\/strong>([1, 3, 5]);\n\n","truncated":false}}
